import React from 'react';
import { BrowserRouter as Router, Route} from 'react-router-dom';
import EmailForm from '../components/EmailForm/EmailForm';
import IELTSAcademic from './IELTSAcademic';
import IELTSGeneral from './IELTSGeneral';
import TOELF from './TOELF';
import ChooseTest from './ChooseTest';


const Home = () =>{
    return (
        <Router>
            
            <Route exact path="/IELTSAcademic"><IELTSAcademic/></Route>
            <Route exact path="/IELTSGeneral"><IELTSAcademic/></Route>
            <Route exact path="/TOELF"><IELTSAcademic/></Route>

            <Route exact path="/ChooseTest"><ChooseTest/></Route>
            <Route exact path="/Home"><EmailForm name="this is button" path="/ChooseTest"/></Route>
        </Router>
        
    )
}

export default Home;
